import React from "react";
import facebook from "../assets/facebook.png";
import google from "../assets/google.png";
import apple from "../assets/apple.png";

const SignIn = () => {
  return (
    <div className="h-screen w-screen flex border border-black">
      {/*heading  */}
      <div className="flex flex-col w-full">
        {/* heading */}
        <div className="border border-red-900">
          <h1 className="text-[1.25rem] non-italic text-[#69235B] font-bold leading-5 text-center">
            <span className="relative before:absolute before:z-[-100] before:top-[70%] before:left-0 before:bg-[#FFC746] before:w-[110%] before:h-1/2">
              Log in
            </span>{" "}
            to Mokx
          </h1>
        </div>
        {/* paragraph */}
        <div className="border border-red-900">
          <p className="text-[#69235B] text-center text-[0.875] font-light leading-5 tracking-[0.00625rem]">
            Welcome back! Sign in using your social account or email to continue
            us
          </p>
        </div>
        {/* Authentication - FaceBook,Google,Apple */}
        <div className="border border-red-900 flex justify-center space-x-[1.5rem]">
          <div className="rounded-full border border-black h-[2.875rem] w-[2.875rem]">
            <img src={facebook} alt="" className="h-full w-full " />
          </div>
          <div className="rounded-full border border-black">
            <img src={google} alt="" className="h-[2.875rem] w-[2.875rem]" />
          </div>
          <div className="rounded-full border border-black">
            <img src={apple} alt="" className="h-[2.875rem] w-[2.875rem]" />
          </div>
        </div>
      </div>

      {/* foam */}
      <div></div>
    </div>
  );
};

export default SignIn;
